import React, { useEffect } from 'react';
import { ToastContainer, toast } from 'react-toastify';

function Home({ isLoginSuccess }) {
  useEffect(() => {
    if (isLoginSuccess) {
      toast.success('Login successful!', { position: toast.POSITION.TOP_CENTER });
    }
  }, [isLoginSuccess]);

  return (
    <div>
      {/* Home page content */}
      <h1>Hello</h1>
      <ToastContainer />
    </div>
  );
}

export default Home;
